import React from "react";
import Nav from "react-bootstrap/Nav";
import NavItem from "./MainNav/NavItem";

const MainNav = () => {
  const datas = [
    "New In",
    "Category",
    "Most Wanted",
    "Gifting",
    "Shop All",
    "SALE",
  ];

  return (
    <Nav className="navbar navbar-expand-lg main-nav">
      {datas.map((data, i) => {
        return <NavItem data={data} key={i} />
      })}
    </Nav>
  );
}

export default MainNav;
